import './App.css';
import React, {Component} from "react"
import Goal from "./Goal"

export default class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      sessions: ['TU','WE','TH','FR'],
      steps: ['Class','Lab','Homework','Stretch'],
      weeks: 2
    }
  }



  render() {
    return (
      <div className='App'>
        <h1>Pixel Progress</h1>
        <Goal
        sessions={this.state.sessions.length}
        steps={this.state.steps.length}
        weeks={this.weeks}
        />
      </div>
    )
  }
}
